Information
------------------------------

The Incredible Journey of the Monarch Butterfly
Known for their stunningly beautiful colours and mystical powers of transformation, the humble butterfly is revered by many. In one small creature lays the mystery of creation as in a short lifetime a full evolution occurs. Amongst the most captivating is the Monarch Butterfly. Known as the wandered , this striking orange insect undertakes a mammoth voyage that many of its larger counterparts could not even fathom. Follow this incredible creature and allow yourself to be lost in its magic as this Blu-ray feature allows you to have a firsthand experience of the glorious Monarch Butterfly. A captivating journey for the whole family! Narrated By Glen McCready

